drop table if exists users;
drop table if exists key_value_setup;
drop table if exists departments;

CREATE TABLE `users` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`title`	VARCHAR ( 50 ),
	`first_name`	VARCHAR ( 50 ),
	`last_name`	VARCHAR ( 50 ),
	`email`	VARCHAR ( 50 ),
	`gender`	VARCHAR ( 50 ),
	`department`	VARCHAR ( 50 )
);



create table key_value_setup ( 
	`key` VARCHAR(50),
	`value` VARCHAR(50)
);

create table departments ( 
	`code` VARCHAR(50),
	`name` VARCHAR(50)
);




Select distinct 'user_title',title from users;

Select distinct 'user_gender',gender from users;

Select distinct department,department from users;